import React, { useState } from "react";
import Table from "./tableComponent/table";
import FormDataForm from "./generalform";

const Advertisements = () => {
    return (
        <div>
            <div>
                <Table
                    apiUrl="http://localhost:8080/advertisement/monitor"
                    itemName="Advertisements"
                    itemKeys={["title", "location", "wage", "contact"]}
                    customColumns={["Job", "Location", "Wage", "Contact"]}
                />
            </div>
            <div>
                <FormDataForm
                    apiUrl={"http://localhost:8080/advertisement"}
                    formFields={[
                        {
                            name: "companyid",
                            label: "Company name",
                            type: "text",
                        },
                        {
                            name: "title",
                            label: "Job",
                            type: "text",
                        },
                        {
                            name: "contact",
                            label: "Contact",
                            type: "email",
                        },
                        {
                            name: "location",
                            label: "Location",
                            type: "text",
                        },
                        {
                            name: "description",
                            label: "Job description",
                            type: "text",
                        },
                        {
                            name: "wage",
                            label: "Wage",
                            type: "text",
                        },
                    ]}
                />
            </div>
        </div>
    );
};

export default Advertisements;
